import React from 'react';
import './card-style.css'

export const Card = props => (
  <div className="card-container">
    <img alt="moster" src={`https://robohash.org/${props.monster.id}?set=set2&size=180x180`}/>
    <h1> {props.monster.name} </h1>
  </div>
)
